import React, { Component } from 'react';
import Spinner from 'react-bootstrap/Spinner';
import Nav from 'react-bootstrap/Nav'
import { Link } from 'react-router-dom';
import Table from 'react-bootstrap/Table';
import { patho } from '../services/vep.service';

class Vep extends Component {

    constructor(props) {
        super(props);

        this.state = {
            isShow: false,
            user: {},
            data: [],
            chromosome: {},
            hgsvG: {}
        };

    }

    componentDidMount() {
        this.setState({ 
            user: JSON.parse(localStorage.getItem('user')),
            data: { loading: true },
            chromosome: this.props.chromosome,
            hgsvG: this.props.hgsvG
        });

        this.updatePatho = this.updatePatho.bind(this);
    }

    updatePatho = () => {
        const { chromosome, hgsvG } = this.state

        patho.getPathogenicity(chromosome, hgsvG).then(data => {
            this.setState({ data })
        })
    }

    render() {
        const { data } = this.state;
        // Clinvar API Returns: AminoAcidChange,Chromosome,GeneSymbol,phenotype,NucleotideChange

    return (
        <div>
            <button onClick={this.updatePatho} type="button">
                Get VEP for {this.props.hgsvG}
            </button>

        {!data.loading && 
            <div>
                <h2>Clinvar Results</h2>
                {JSON.stringify(data)}
            </div>
            }

        </div>
    );
    }
}

export { Vep };
